/* eslint-disable react/jsx-filename-extension */
import React from "react";

import Team from "../assets/images/team.png";

export default function HeroTeam() {
  return (
    <section className="flex flex-col sm:justify-between items-center sm:flex-row mt-12 md:mt-2">
      <div className="w-full sm:w-1/2 flex flex-col px-5 mb-5 sm:mb-0 sm:px-12 sm:mt-6 lg:mt-6 xl:mt-20">
        <h1 className="text-4xl text-theme-blue font-bold leading-tight mb-5">
          Our Team
        </h1>
        <p className="font-light text-xl text-gray-400 leading-relaxed">
          Our team is full of passionate people and ready to make your dream
          software come true.
        </p>
      </div>
      <div className="w-full sm:w-1/2 sm:pr-12">
        <img src={Team} alt="Hero" />
      </div>
    </section>
  );
}
